export default function Table({ columns, children }) {
    return (
        <table>
            <thead className="text-left border-b border-black/10 text-zinc-700">
                <tr>
                    {columns.map((column, index) => (
                        <th key={index} className="p-2 pl-4">{column}</th>
                    ))}
                </tr>
            </thead>

            <tbody>
                <tr className="border-b even:bg-[#fafafa] even:hover:bg-black/10 border-black/10 hover:bg-black/5 text-zinc-700">
                    {children}
                </tr>
            </tbody>
        </table>
    )
}
